    c = (c * global_vars.frametime) * 20
    if N == false then
        if j then
            k = k + c
        else
            k = k - c
        end
    else
        if j then
            k = k + (s - k) * (c / 100)
        else
            k = k - (0 + k) * (c / 100)
        end
    end
    if m then
        if k > s then
            k = s
        elseif k < 0 then
            k = 0
        end
    end
    return k
end
